/**
 * PDF Builder Pro - Admin Script
 * Interface entre WordPress et le Canvas
 */

(function($) {
    'use strict';

    console.log('PDF Builder Pro: Admin script loaded');

    // Exposition globale pour WordPress
    window.PDFBuilderPro = {
        /**
         * Initialise l'application PDF Builder
         * @param {string} containerId - ID du conteneur HTML
         */
        init: function(containerId) {
            console.log('PDFBuilderPro.init called with containerId:', containerId);

            // Attendre que PDFBuilderPro soit disponible
            const waitForPDFBuilderPro = (attempts = 0) => {
                const maxAttempts = 50;

                if (typeof window.PDFBuilderPro !== 'undefined' && window.PDFBuilderPro.init) {
                    console.log('PDFBuilderPro found, initializing...');
                    try {
                        window.PDFBuilderPro.init({
                            containerId: containerId
                        });
                        console.log('PDFBuilderPro initialized successfully');
                    } catch (error) {
                        console.error('Error initializing PDFBuilderPro:', error);
                    }
                    return;
                }

                if (++attempts < maxAttempts) {
                    console.log('PDFBuilderPro not ready, retrying... (attempt ' + attempts + ')');
                    setTimeout(() => waitForPDFBuilderPro(attempts), 100);
                } else {
                    console.error('PDFBuilderPro never became available after', maxAttempts, 'attempts');
                }
            };

            waitForPDFBuilderPro();
        }
    };

    console.log('PDF Builder Pro: window.PDFBuilderPro.init is now available');

})(jQuery);
